import {useEffect,useState} from 'react'
import { getallcotizaciones } from '../api/cotizaciones.api';
import 'bootstrap-table/dist/bootstrap-table.js'

    
    export function CotizarList(){
        const dummyCotizar = [
            { date: 'DateN1', client: 'ClientN1', value: 'ValueN1' },
            { date: 'DateN2', client: 'ClientN2', value: 'ValueN2' },
        ];
        
        const [cotizaciones , setcotizaciones] = useState();
        
        useEffect( ()=> {
            async function loadcotizaciones(){
                const res = await getallcotizaciones();
                console.log(res);
                setcotizaciones(res.data)
            }
            loadcotizaciones()
        }, []);
      return (
        <div>
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Date</th>
                        <th>Client</th>
                        <th>Value</th>
                    </tr>
                </thead>
                <tbody>
                    {cotizaciones.map((cotizacion, index) => (
                    <tr key={index}>
                        <td>{index + 1}</td>
                        <td>{cotizacion.date}</td>
                        <td>{cotizacion.name}</td>
                        <td>{cotizacion.value}</td>
                    </tr>
                    ))}
                </tbody>
            </Table>
        </div>
      );
  }
